function SponsoredBills({ repSponsoredBills }) {
    console.log('votevote:', repSponsoredBills)
    return (
        <div>
            { repSponsoredBills && repSponsoredBills.intro(
                <table>
                    <tbody>
                        {repSponsoredBills.map((bill, index) => (
                            <tr key={`bill-${index}`}>
                                <td>{bill.introduce.Date}</td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            )}
        </div>
    );
}

export default SponsoredBills;
